export default (function(a,b,c,d,e,f){return {data:{"9UMOX6oUQy":{data:{id:2082,attributes:{imdbId:"tt0119891",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNTM2ZmEwZTEtOGI4OC00NDJlLWFhYWUtNGIyMDU5NGE5OTE4XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.4\u002F10"},{Source:"Rotten Tomatoes",Value:"13%"},{Source:"Metacritic",Value:"26\u002F100"}],item_lang:{data:{id:2745,attributes:{title:c,plot:"People have vanished in a small ski resort village nestled in the Rocky Mountains. Two sisters suspect it to be the work of a serial killer on the loose in town but there is no blood near the dead bodies, no sign of struggle n how can a single serial killer kill all the residents. The sisters come across a sheriff who is a former FBI agent. The agent calls up for back up. The agents' associates gets hold of an academic who theorizes the town has fallen victim to the Ancient Enemy, which periodically wipes out civilizations including that of the Mayans and the Roanoke Island colonists.",slug:"phantoms"}}},books:{data:[{id:10359,attributes:{title:c,description:"After finding one hundred and fifty people grotesquely dead in the tiny mountain town of Snowfield, California, officials cannot imagine anything as gruesome as the real reason for their death.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=W92G66feePQC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Dean Ray Koontz"],firstBook:true,published:"1997-09-01",publisher:"Berkley",subtitle:a}},{id:10360,attributes:{title:e,description:a,thumbnail:a,authors:[d],firstBook:b,published:"1996-04-01",publisher:f,subtitle:"Phantoms, the Servants of Twilight, the Bad Place"}},{id:10361,attributes:{title:"Phantoms!",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=mWpyPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:b,published:"2002-01-01",publisher:a,subtitle:a}},{id:10362,attributes:{title:"Koontz I",description:a,thumbnail:a,authors:[d],firstBook:b,published:"1991-09-01",publisher:f,subtitle:"Voice of the Night\u002FBad Place\u002FPhantoms\u002FBoxed Set"}},{id:10363,attributes:{title:c,description:"“Phantoms is gruesome and unrelenting…It’s well realized, intelligent, and humane.”—Stephen King They found the town silent, apparently abandoned. Then they found the first body, strangely swollen and still warm. One hundred fifty were dead, 350 missing. But the terror had only begun in the tiny mountain town of Snowfield, California. At first they thought it was the work of a maniac. Or terrorists. Or toxic contamination. Or a bizarre new disease. But then they found the truth. And they saw it in the flesh. And it was worse than anything any of them had ever imagined...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7-gcMsbRhHgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[e],firstBook:b,published:"2002-02-05",publisher:"Penguin",subtitle:"A Thriller"}}]}}},meta:{}}},prerenderedAt:1680940943127}}("",null,"Phantoms","Dean R. Koontz","Dean Koontz","Berkley Publishing Group"))